<script src="./js/handlebars.js"></script>
<script src="./js/angular.js"></script>

<style>
    .rChart {
        display: block;
        margin-left: auto; 
        margin-right: auto;
        width: 950px;
        height: 550px;
    }  
    .datamaps {
        position: relative;
    }
</style>

<body ng-app ng-controller='rChartsCtrl'>
    <div class='container'>
        <input id='slider' type='range' min=1993 max=2012 ng-model='year' width=200>
        <span ng-bind='year'></span>
        <div id='chart_1' class='rChart datamaps'></div>  
    </div>
    
    <script>
        var yearSelected = '1993';
        function rChartsCtrl($scope) {
            $scope.year = 1993;
            $scope.$watch('year', function (newYear) {
                mapchart_1.updateChoropleth(chartParams.data[newYear]);
                yearSelected = newYear;
            });
        };
    </script>    
        <script id='popup-template' type='text/x-handlebars-template'></script>
    <script>
var co2csvdataarray  = new Array();
d3.csv("./data/CO2 emissions (kt).csv", function(data){
    data.forEach(function(d){
        for (var i = 1993; i < 2014; i++) {
            if (d[i] == "") {
                d[i] = "data not collected";
            }
        }
        co2csvdataarray [d["Country Code"]]=d;
    })
});

var co2metriccsvdataarray  = new Array();
d3.csv("./data/CO2 emissions (metric tons per capita).csv", function(data){
    data.forEach(function(d){
        for (var i = 1993; i < 2014; i++) {
            if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    co2metriccsvdataarray [d["Country Code"]] = d;
                })
            });

            var electricityproductiondataarray = new Array();
            d3.csv("./data/Electricity production.csv", function (data) {
                data.forEach(function (d) {
                    for (var i = 1993; i < 2014; i++) {
                        if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    electricityproductiondataarray [d["Country Code"]] = d;
                })
            });

            var electricityexcludehydroelectric = new Array();
            d3.csv("./data/Electricity production exclude.csv", function (data) {
                data.forEach(function (d) {
                    for (var i = 1993; i < 2014; i++) {
                        if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    electricityexcludehydroelectric [d["Country Code"]] = d;
                })
            });

            var forestareadataarray = new Array();
            d3.csv("./data/Forest area.csv", function (data) {
                data.forEach(function (d) {
                    for (var i = 1993; i < 2014; i++) {
                        if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    forestareadataarray [d["Country Code"]] = d;
                })
            });

            var terrestrialandmarineprotecteddataarray = new Array();
            d3.csv("./data/Terrestrial and marine protected areas.csv", function (data) {
                data.forEach(function (d) {
                    for (var i = 1993; i < 2014; i++) {
                        if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    terrestrialandmarineprotecteddataarray [d["Country Code"]] = d;
                })
            });

            var naturalresourcesrentsdataarray = new Array();
            d3.csv("./data/Total natural resources rents.csv", function (data) {
                data.forEach(function (d) {
                    for (var i = 1993; i < 2014; i++) {
                        if (d[i] == "") {
                            d[i] = "data not collected";
                        }
                    }
                    naturalresourcesrentsdataarray[d["Country Code"]] = d;
                })
            });

var chartParams = {
"dom": "chart_1",
"width": 950,

"scope": "world",

geographyConfig: {

      setProjection = function( element, options ) {
        var projection, path;
        
        projection = d3.geo.albersUsa()
            .scale(element.offsetWidth)
            .translate([element.offsetWidth / 2, element.offsetHeight / 2]);
            path = d3.geo.path().projection(projection);
            return {path: path, projection: projection};
        };
